import logo from './logo.svg';
import './App.css';


const searchresults = [
  {
  "url": "yandex.ru",
  "title": "cars",
  "text": "i like cars very much"
  },
  {
  "url": "vk.ru",
  "title": "planes",
  "text": "i like planes not so much"
  },
  {
  "url": "google.com",
  "title": "trains",
  "text": "i like trains"
  }
]

function ResultCard({result}) {
    return (
      <li>
        <a href={result.url}>link</a>
        <h1>{result.title}</h1>
        <p>{result.text}</p>
      </li>
    )
}

function App() {
  return (
    <div className="App">

      <input type="text" id="fname" name="fname"/>
      <button label="search"/>

      <ol>
        <ResultCard result={searchresults[0]}/>
        <ResultCard result={searchresults[1]}/>
        <ResultCard result={searchresults[2]}/>
      </ol>



    </div>
  );
}

export default App;
